// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div style={{position: relative}}>
          <img class="App-logo" alt="logo" src="https://scontent.fhan3-2.fna.fbcdn.net/v/t1.0-9/89632938_2622333148051433_9115370604545966080_o.jpg?_nc_cat=109&amp;ccb=2&amp;_nc_sid=09cbfe&amp;_nc_ohc=tZHuk80ObXcAX9bXnqi&amp;_nc_ht=scontent.fhan3-2.fna&amp;oh=15c8c6c369d99aa90e0e00f1d9408072&amp;oe=5FF6A301" />
          <div style="position: absolute;width: 100%;bottom: -80px;transform: rotate(180deg);">
            <img src="https://soibien.vn/media/img/product/365/1254569_0.jpg" style="width: 100%;" />
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
